INSERT INTO `p8_page_` (`id`,`fid`,`name`,`title`,`timestamp`,`uid`,`username`,`style`,`type`,`tpl_head`,`tpl_main`,`tpl_foot`,`htmlize`,`tpl_mobile`,`html_view_url_rule`,`filepath`,`descrip`,`keywords`,`content`,`hits`,`ishtml`) VALUES ('1','0','学院简介','学院简介','1271219850','1','','','0','header1','page_yuanxi','foot2','1','','{$system_url}/page/{$id}.html','','','','<p>\r\n	　<br />\r\n	　<strong><font color=\"#0021b0\" size=\"5\">广东华南理工大学信息学院</font></strong><br />\r\n	　　<br />\r\n	　　<font color=\"#2690fe\" size=\"3\">Guanzhou guowei soft Technology CO.,Ltd</font></p>\r\n<p>\r\n	<br />\r\n	　　<span style=\"font-size:14px;\">&nbsp;<b>学院基本介绍</b></span><strong>&nbsp;<br />\r\n	<br />\r\n	　　</strong><span style=\"font-size: 14px; text-align: -webkit-center; background-color: rgb(255, 255, 255); font-family: 宋体; \"> &nbsp; 山西农业大学位于山西省太谷县，创建于1907年，是中国历史最悠久的大学之一。学校历经铭贤学堂、铭贤农工专科学校、铭贤学院、山西农学院等时期，1979年更名山西农业大学，被列为全国重点高校，彭真同志题写校名。在跨越一个世纪的办学历程中，学校以&ldquo;甘于奉献、敬业乐教&rdquo;的教风，&ldquo;勤奋学习、注重实践&rdquo;的学风和&ldquo;崇学事农，艰苦兴校&rdquo;的精神享誉海内外。党的十一届三中全会以来，特别是近年来，学校各方面取得了长足的发展，受省级以上表彰百余项。在2005</span><span style=\"font-family: serif; font-size: 14px; text-align: -webkit-center; background-color: rgb(255, 255, 255); \">年的教育部本科教学工作水平评估中获得优秀。2007年成功举办了百年校庆纪念活动。</span><br />\r\n	<br />\r\n	　　</p>\r\n<p>\r\n	　　<font size=\"2\"><a href=\"<!--#p8_attach#-->/core/page/2012_07/14_22/df9dec4fc221bc67.jpg\" target=\"_blank\"><img alt=\"55.jpg\" src=\"<!--#p8_attach#-->/core/page/2012_07/14_22/df9dec4fc221bc67.jpg.cthumb.jpg\" style=\"width: 600px; height: 402px; \" /></a></font><br />\r\n	<br />\r\n	<br />\r\n	　　<span style=\"font-size:14px;\"><span style=\"text-align:-webkit-center;\">&nbsp; &nbsp; 学校在校生2万余人，教职员工1600</span>余人，其中副高以上职称400余人，80%以上的中青年教师具有硕士以上学位；有特聘院士3人；国家有突出贡献专家2人，省（部）级青年学科带头人、省中青年骨干教师60余人；40多名教授享受政府特殊津贴。<br />\r\n	<br />\r\n	　　山西农业大学信息学院是2002年经山西省人民政府批准成立，2003年国家教育部正式确认的由百余年历史文化传承的著名学府山西农业大学以新的机制和模式举办的独立学院，是一所以农学、理学、工学、管理学、经济学、文学等多学科综合配套、协调发展的全日制综合性本科高校。<br />\r\n	<br />\r\n	　　学院位于闻名遐迩的晋商故里山西省太谷县。太谷县始建于西汉，历史悠久，文化商贸发达，境内有诸多晋商大院遗存，以曹家大院和孔祥熙宅院为其代表。是盛唐诗人白居易的祖籍地，近代大财阀孔祥熙的出生地。明清民国时期，太谷富商巨贾云集，成为山西的金融、商业中心，固有&ldquo;旱码头&rdquo;、&ldquo;小北京&rdquo;之称。<br />\r\n	<br />\r\n	　　学院新校区规划用地1800亩，目前校园用地991.8亩，学院共拥有教学行政用房、学生宿舍、食堂建筑面积35万平方米，塑胶运动场17850平方米，篮球场5120平方米。教学仪器设备总值3000余万元，图书资料92万册，建有先进的多媒体微机室、语音室、工程实验室、制图室、画室、物理实验室、化学实验室、分子实验室、生物实验室等各类教学实验室。学院主体工程全部采用混凝土框架结构建设，抗震等级按八度设防。经过持续不断地建设，学院新校区功能完善、环境优美、配套设施设备先进，能容纳3万余名学生在校学习。<br />\r\n	<br />\r\n	　　</span></p>\r\n','0','0');
