INSERT INTO `p8_vote_` (`id`,`name`,`frame`,`template`,`label_template`,`content`,`enabled`,`multi`,`page_size`,`roles`,`viewable`,`vote_to_view`,`view_voter`,`vote_interval`,`votes`,`timestamp`,`expire`,`captcha`) VALUES ('2','国微CMS：校园十大歌手决赛投票','','multi_vote','vote','一年一度的校园“十佳”歌手大赛是我校传统活动，在以往的活动中，我们积累了大量的成功经验，每一次的“十佳”歌手大赛都培养了大批的校园明星。在摇滚乐中已有自己一片天的郑君，著名网络歌手阳一及新手悠悠和刘雁都是通过杭电这个十佳的舞台走向他们的星光大道。今年我们很高兴看到又有大量的新鲜血液加入我校，其中不乏许多具有文艺特长的同学，为我校举办本届校园“十佳”歌手大赛打下了良好的基础。在此，杭州电子科技大学学生会将与校内各有关部门积极配合，为本次校园“十佳”歌手大赛的顺利开展做好充分的准备工作，让所有在校师生体验来自听觉和视觉的享受。 4月28日，我们共同期待。','1','1','0','','0','1','1','1000','7','1346236244','0','0');
